import React from 'react';
import { Parallax } from 'react-scroll-parallax';
import PropTypes from 'prop-types';
import exact from 'prop-types-exact';

const ParallaxDisableBoolean = ({ isDisabled, img }) => (
	<React.Fragment>
		<Parallax
			disabled={isDisabled}
			className="custom-class"
			offsetYMax={10}
			offsetYMin={-220}
			slowerScrollRate
			tag="figure">
			<img src={img} alt="image description" />
			<h3>With Boolean</h3>
		</Parallax>
	</React.Fragment>
);

ParallaxDisableBoolean.propTypes = exact({
	isDisabled: PropTypes.bool,
	img: PropTypes.string,
});

export default ParallaxDisableBoolean;
